import DashboardStats from './components/DashboardStats'
import AmountStats from './components/AmountStats'
import PageStats from './components/PageStats'
import axios, { CancelToken } from 'axios';
import { jwtDecode } from "jwt-decode";
import {useNavigate} from "react-router-dom";
import UserGroupIcon  from '@heroicons/react/24/outline/UserGroupIcon'
import UsersIcon  from '@heroicons/react/24/outline/UsersIcon'
import PresentationChartBarIcon  from '@heroicons/react/24/outline/PresentationChartBarIcon'
import InboxArrowDownIcon  from '@heroicons/react/24/outline/InboxArrowDownIcon'
import CircleStackIcon  from '@heroicons/react/24/outline/CircleStackIcon'
import CreditCardIcon  from '@heroicons/react/24/outline/CreditCardIcon'
import UserChannels from './components/UserChannels'
import LineChart from './components/LineChart'
import BarChart from './components/BarChart'
import DashboardTopBar from './components/DashboardTopBar'
import { useDispatch } from 'react-redux'
import {showNotification} from '../common/headerSlice'
import DoughnutChart from './components/DoughnutChart'
import { useState, useEffect } from 'react'

const statsData = [
    {
        title: "Total Sales",
        value: "$22,110",
        icon: (
            <button className="btn btn-circle bg-primary text-white">
                <CreditCardIcon className="w-6 h-6" />
            </button>
        ),
        description: "↗︎ 2300 (22%)"
    },
    {
        title: "Purchase",
        value: "$7,545",
        icon: (
            <button className="btn btn-circle bg-primary text-white">
                <InboxArrowDownIcon className="w-6 h-6" />
            </button>
        ),
        description: "Current month"
    },
    {
        title: "Customers",
        value: "713",
        icon: (
            <button className="btn btn-circle bg-primary text-white">
                <UserGroupIcon className="w-6 h-6" />
            </button>
        ),
        description: "50 in hot leads"
    },
    {
        title: "Sales Amount",
        value: "$31,111",
        icon: (
            <button className="btn btn-circle bg-primary text-white">
                <PresentationChartBarIcon className="w-6 h-6" />
            </button>
        ),
        description: "↙ 300 (9%)"
    }
];



function Dashboard(){

    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [role, setRole] = useState('');
    const [token, setToken] = useState('');
    const [expire, setExpire] = useState('');
    const [users, setUsers] = useState([]); // Untuk menyimpan data pengguna
    const navigate = useNavigate();

    useEffect(() => {
        refreshToken();
    }, []);

    const refreshToken = async () => {
        try {
            const response = await axios.get('http://localhost:5000/token');
            setToken(response.data.accessToken);
            const decoded = jwtDecode(response.data.accessToken);
            setName(decoded.name); 
            setEmail(decoded.email);
            setRole(decoded.role);
            setExpire(decoded.exp);
        } catch (error) {
            console.error("Error refreshing token:", error.response);
            navigate("/login");
        }
    };

    // Interceptor untuk menambahkan token ke setiap permintaan
    axios.interceptors.request.use(
        (config) => {
            const currentDate = new Date();
            if (token && expire * 1000 < currentDate.getTime()) {
                refreshToken();
            }
            config.headers.Authorization = `Bearer ${token}`;
            return config;
        },
        (error) => {
            console.error("Error in interceptor:", error);
            return Promise.reject(error);
        }
    );

    const getUsers = async () => {
        try {
            console.log("Attempting to fetch users with token:", token);
            const response = await axios.get('http://localhost:5000/users', {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            console.log("Users fetched:", response.data);
            setUsers(response.data); // Simpan data pengguna ke state
        } catch (error) {
            if (error.response) {
                console.error("Error fetching users:", error.response.data);
                console.error("Status code:", error.response.status);
            } else {
                console.error("Error fetching users:", error.message);
            }
        }
    };

    useEffect(() => {
        if (token) {
            getUsers();
        }
    }, [token]);

    const dispatch = useDispatch()
 

    const updateDashboardPeriod = (newRange) => {
        // Dashboard range changed, write code to refresh your values
        dispatch(showNotification({message : `Period updated to ${newRange.startDate} to ${newRange.endDate}`, status : 1}))
    }

    return(
        <>
        {/** ---------------------- Select Period Content ------------------------- */}
            <DashboardTopBar updateDashboardPeriod={updateDashboardPeriod}/>
            <div>
                <h1>Welcome : {name}</h1>
                <button onClick={getUsers}>Get Users</button>
            </div>
        
        {/** ---------------------- Different stats content 1 ------------------------- */}
            <div className="grid lg:grid-cols-4 mt-2 md:grid-cols-2 grid-cols-1 gap-6">
                {
                    statsData.map((d, k) => {
                        return (
                            <DashboardStats key={k} {...d} colorIndex={k}/>
                        )
                    })
                }
            </div>



        {/** ---------------------- Different charts ------------------------- */}
            <div className="grid lg:grid-cols-2 mt-4 grid-cols-1 gap-6">
                <LineChart />
                <BarChart />
            </div>
            
        {/** ---------------------- Different stats content 2 ------------------------- */}
        
            <div className="grid lg:grid-cols-2 mt-10 grid-cols-1 gap-6">
                <AmountStats />
                <PageStats />
            </div>

        {/** ---------------------- User source channels table  ------------------------- */}
        
            <div className="grid lg:grid-cols-2 mt-4 grid-cols-1 gap-6">
                <UserChannels />
                <DoughnutChart />
            </div>
        </>
    )
}

export default Dashboard
